import { useState } from "react";
import SwitchTabs from "./onBoarding";
import Welcome from "./welcome";

function Home() {
    const [isLogin, setLogin] = useState(true);
    
    return (
        <div>
            {
                isLogin ?
                    <Welcome/>
                :
                    <SwitchTabs/>
            }
        </div>
    )
}
export default Home;
